map.on('click', 'hap_loc', (e) => {
    // Copy coordinates array.
    const coordinates = e.features[0].geometry.coordinates.slice();
    const properties = e.features[0].properties;
    console.log(properties.Lat)
    const description = 
    `<h4><strong>HAP Location</strong></h4>
    <p><a href=` + properties.MapURL + ` target="_blank">Downloadable Map</a></p>
    <h8><strong>` + properties.Township +  ` Township, ` +  properties.County + ` County</strong></h8>
    <p><b>Landowner: </b>` + properties.LandownerName + `</p>
    <p><b>Property Location: </b>` + properties.PropertyLocation + `</p>
    <p><b>HQ Location: </b>` + properties.HeadquartersLocation + `</p>
    <p><b>Hunt Types: </b>` + properties.HuntTypesAllowed + `</p>
    <p><b>ServiceType: </b>` + properties.ServiceType + `</p>
    <p><b>Hunters: </b>` + properties.Hunters+ `</p>
    <p><b>TotalAcres: </b>` + properties.TotalAcres + `</p>
    <p>&nbsp; &nbsp; &nbsp; &nbsp; <i>Wetland Acres: </i>` + properties.WetlandAcres + `;</p>
    <p>&nbsp; &nbsp; &nbsp; &nbsp; <i>Forest Acres: </i>` + properties.ForestAcres + `</p>
    <p>&nbsp; &nbsp; &nbsp; &nbsp; <i>Grassland/Brush Acres: </i>` + properties.GrasslandorBrushAcres + `</p>
    <p>&nbsp; &nbsp; &nbsp; &nbsp; <i>Crop Acres: </i>` + properties.CroporHayorPastureAcres + `</p>
    <p><b>Notes: </b>` + properties.SpecialNotes + `</p>`;


    // Ensure that if the map is zoomed out such that multiple
    // copies of the feature are visible, the popup appears
    // over the copy being pointed to.
    while (Math.abs(e.lngLat.lng - coordinates[0]) > 180) {
        coordinates[0] += e.lngLat.lng > coordinates[0] ? 360 : -360;
    }

    new mapboxgl.Popup()
        .setLngLat(coordinates)
        .setHTML('<h1>' + description + '</h1>')
        .addTo(map);
});

// Change the cursor to a pointer when the mouse is over the places layer.
map.on('mouseenter', 'hap_loc', () => {
    map.getCanvas().style.cursor = 'pointer';
});

// Change it back to a pointer when it leaves.
map.on('mouseleave', 'hap_loc', () => {
    map.getCanvas().style.cursor = '';
});


